import React from 'react';
import logo from './logo.svg';
import {Provider,defaultTheme,Grid} from '@adobe/react-spectrum';
import './App.css';
import LoginForm from './components/Loginform';

function App() {
  return (
    <div className="App">
      <Provider theme={defaultTheme}>
        <Grid areas={[ 'content']}  
              columns={['1fr', '3fr']}
              rows={['size-1000', 'auto', 'size-1000']}
              height="size-6000"
              gap="size-100" >
          <View backgroundColor="purple-600" gridArea="content" />
        </Grid>
        <LoginForm />
      </Provider>
    </div>
  );
}

export default App;
